    false,nt"url": null,nt"notes": "The "Syria IDP Sites" dataset is compiled
    by the U.S. Department of State, Humanitarian Information Unit (INR/GGI/HIU). This
    dataset contains open source derived data about the geographic locations (point
    geometry) of identified tent camps and other locations, such as collective centers,
    schools, mosques, etc. in and nearby towns inside Syria where displacement has taken
    place. "IDP Site" refers to informal or formal settlements for specific IDP use.
    Site names are not authoritative. Sources of this information include the United
    Nations, the Assistance Coordination Unit, the Syria Needs Assessment Project, NGOs,
    and media reports. Location coordinates are approximated and are plotted using the
    Syria P-Code system (http://www.mapaction.org/map-catalogue/mapdetail/2753.html)
    and NGA GeoNames (http://earth-info.nga.mil/gns/html) datasets. The field "PCode"
    is a combination of the all the administrative level and community level P-Codes
    for a specific location. Site locations are verified using high-resolution commercial
    satellite imagery. The data contained herein is entirely unclassified and is current
    as of early January 2016. The data is updated as needed.",nt"license_title":
